import './App.css';
import ReactPlayer from 'react-player'

class Video extends Component {



  render() {
    return (
      <div >

     <div id="myVideo">
      <iframe class="videoContainer__video" width="1920" height="1080" src="https://www.youtube.com/embed/j5z02QN8XvE" frameborder="0"></iframe>
  </div>
      </div>
    );
  }
}

export default Video;
